CREATE DEFINER=`intencit`@`localhost` PROCEDURE `getAllDisplayMuscleGroups`(IN `email` VARCHAR(75))
begin

declare routineNumber int default 0;

declare currentMuscleGroup varchar(25);

set routineNumber = (SELECT MuscleGroupRoutine.RoutineNumber
                     FROM MuscleGroupRoutine
                     INNER JOIN CompletedMuscleGroup
                     ON CompletedMuscleGroup.MuscleGroupName = MuscleGroupRoutine.MuscleGroupName
                     WHERE CompletedMuscleGroup.Email = email
                     ORDER BY CompletedMuscleGroup.ID DESC
                     LIMIT 1);

/* Sets the routine number to the first 1 if it has reached the
   end of the routine numbers in MuscleGroupRoutine. */
IF (routineNumber = (SELECT MuscleGroupRoutine.RoutineNumber
                    FROM MuscleGroupRoutine
                    ORDER BY MuscleGroupRoutine.RoutineNumber DESC
                    LIMIT 1)) THEN
	SET routineNumber = 1;
ELSE
	SET routineNumber = routineNumber + 1;
END IF;

SET currentMuscleGroup = (SELECT MuscleGroupRoutine.DisplayName
                          FROM MuscleGroupRoutine
                          WHERE MuscleGroupRoutine.RoutineNumber = routineNumber
                          GROUP BY MuscleGroupRoutine.DisplayName);

SELECT DisplayName, currentMuscleGroup
FROM MuscleGroupRoutine
GROUP BY DisplayName
ORDER BY MuscleGroupRoutine.RoutineNumber;

end$$

CREATE DEFINER=`intencit`@`localhost` PROCEDURE `getComments`(IN `postId` INT)
begin

SELECT User.ID AS userId,
    User.FirstName,
    User.LastName,
    Comment.Date,
    Comment.Time,
    Comment.Comment,
    Comment.Email,
    Comment.ID,
    (SELECT UserMedia.URL 
         FROM UserMedia 
         WHERE UserMedia.Email = Comment.Email
         ORDER BY UserMedia.ID DESC 
         LIMIT 1) as URL
FROM Comment 
INNER JOIN User 
  ON User.Email=Comment.Email 
INNER JOIN Post 
  ON Post.ID=Comment.PostID 
WHERE Post.ID = postId
ORDER BY Comment.Date ASC, Comment.Time ASC;

end$$

