CREATE DEFINER=`intencit`@`localhost` PROCEDURE `getExercise`(IN `email` VARCHAR(75))
begin

declare currentFitnessMean char(1);

declare exerciseNumber int default 27;
declare totalCompletedExercises int default 0;
declare exerciseAmountLeft int default 0;

declare lastExercise varchar(50);
declare secondToLastExercise varchar(50);
declare thirdTolastExercise varchar(50);

declare nextExercise varchar(50);

declare nextExerciseWeight int default 0;
declare nextExerciseDifficulty int default 0;
declare nextExerciseReps varchar(8) default '';
declare nextExerciseDuration varchar(8) default '';


set currentFitnessMean = (SELECT Settings.CurrentFitnessMean 
                          FROM Settings 
                          WHERE Settings.Email = email);

IF (currentFitnessMean = 'G') THEN

    set totalCompletedExercises = (SELECT count(CompletedExercise.ExerciseName) 
                                   FROM CompletedExercise
                                   WHERE CompletedExercise.Email = email && CompletedExercise.Date = CURDATE());
    
    set exerciseNumber = (SELECT FitnessType.ExerciseAmount
                          FROM FitnessType
                          WHERE FitnessType.FitnessType = (SELECT Settings.FitnessType 
                                                           FROM Settings
                                                           WHERE Settings.Email = email));
    
    IF (totalCompletedExercises < exerciseNumber) THEN
    
        set lastExercise = (SELECT CompletedExercise.ExerciseName
                                          FROM CompletedExercise
                                          WHERE CompletedExercise.Email = email && CompletedExercise.Date = CURDATE()
                                          ORDER BY CompletedExercise.Time DESC
                                          LIMIT 1) ;
    
        set secondToLastExercise = (SELECT CompletedExercise.ExerciseName
                                          FROM CompletedExercise
                                          WHERE CompletedExercise.Email = email && CompletedExercise.Date = CURDATE()
                                          ORDER BY CompletedExercise.Time DESC
                                          LIMIT 1, 1);
    
        set thirdTolastExercise = (SELECT CompletedExercise.ExerciseName
                                          FROM CompletedExercise
                                          WHERE CompletedExercise.Email = email && CompletedExercise.Date = CURDATE()
                                          ORDER BY CompletedExercise.Time DESC
                                          LIMIT 2, 1);
    
        IF(lastExercise IS NULL) THEN
            set lastExercise = '';
        END IF;
    
        IF(secondToLastExercise IS NULL) THEN
            set secondToLastExercise = '';
        END IF;
    
        IF(thirdTolastExercise IS NULL) THEN
            set thirdTolastExercise = '';
        END IF;
    
        set nextExercise = (SELECT Exercise.ExerciseName 
                            FROM Exercise
                            INNER JOIN MuscleGroup 
                                ON Exercise.ExerciseName = MuscleGroup.ExerciseName
                            Inner JOIN Equipment
                                ON Exercise.ExerciseName = Equipment.ExerciseName
                            WHERE Exercise.Type = 'E' && 
                                    Exercise.Recommended = 1 && 
                                    (MuscleGroup.MuscleGroupName IN (SELECT CompletedMuscleGroup.MuscleGroupName 
                                                                     FROM CompletedMuscleGroup 
                                                                     WHERE CompletedMuscleGroup.Date = CURDATE() && 
                                                                              CompletedMuscleGroup.Email = email && 
                                                                              CompletedMuscleGroup.MuscleGroupName NOT IN (SELECT Exclusion.ExclusionName 
                                                                                                      FROM Exclusion
                                                                                                      WHERE Exclusion.Email = email && Exclusion.ExclusionType = 'M')) && 
                                                                                                             MuscleGroup.MuscleGroupExercisePercentage >= 50) && 
                                (Equipment.EquipmentName IN (SELECT UserEquipment.EquipmentName 
                                                             FROM UserEquipment 
                                                             WHERE UserEquipment.Email = email) || Equipment.EquipmentName IS NULL) && 
                                Exercise.ExerciseName NOT IN (SELECT Exclusion.ExclusionName
                                                              FROM Exclusion 
                                                              WHERE Exclusion.Email = email && Exclusion.ExclusionType = 'E') &&
                                Exercise.ExerciseName != lastExercise &&
                                Exercise.ExerciseName != secondToLastExercise &&
                                Exercise.ExerciseName != thirdTolastExercise
                            GROUP BY Exercise.ExerciseName
                            ORDER BY RAND()
                            LIMIT 1);

		SET exerciseAmountLeft = exerciseNumber - totalCompletedExercises -1;
    
        IF (nextExercise IS NULL) THEN
            SELECT 'COMPLETED';
        ELSE
			/* Get the last exercise weight from the next exercise */
			SET nextExerciseWeight = (SELECT CompletedExercise.ExerciseWeight
                                      FROM CompletedExercise
                                      WHERE CompletedExercise.Email = email && CompletedExercise.ExerciseName = nextExercise
                                      ORDER BY CompletedExercise.ID DESC
                                      LIMIT 1);

			/* Get the last exercise duration from the next exercise */
            SET nextExerciseDuration = (SELECT CompletedExercise.ExerciseDuration
                                        FROM CompletedExercise
                                        WHERE CompletedExercise.Email = email && CompletedExercise.ExerciseName = nextExercise
                                        ORDER BY CompletedExercise.ID DESC
                                        LIMIT 1);

            /* Get the last exercise reps from the next exercise */
            SET nextExerciseReps = (SELECT CompletedExercise.ExerciseReps
                                    FROM CompletedExercise
                                    WHERE CompletedExercise.Email = email && CompletedExercise.ExerciseName = nextExercise
                                    ORDER BY CompletedExercise.ID DESC
                                    LIMIT 1);
            
			/* Get the last exercise difficulty from the next exercise */
            SET nextExerciseDifficulty = (SELECT CompletedExercise.ExerciseDifficulty
                                          FROM CompletedExercise
                                          WHERE CompletedExercise.Email = email && CompletedExercise.ExerciseName = nextExercise
                                          ORDER BY CompletedExercise.ID DESC
                                          LIMIT 1);

           	SELECT nextExercise, nextExerciseWeight, nextExerciseReps, nextExerciseDuration, nextExerciseDifficulty, exerciseAmountLeft;

        END IF;
    
    ELSE
    
        SELECT 'COMPLETED';
    
    END IF;

ELSEIF (currentFitnessMean = 'R') THEN	

	SET nextExercise = (SELECT CurrentRoutine.ExerciseName
                        FROM CurrentRoutine
                        WHERE CurrentRoutine.Email = email
                        ORDER BY CurrentRoutine.ID ASC
                        LIMIT 1);

	IF (nextExercise IS NOT NULL) THEN

		SELECT nextExercise;

		DELETE FROM CurrentRoutine
        WHERE CurrentRoutine.Email = email
        ORDER BY CurrentRoutine.ID ASC
        LIMIT 1;

	ELSE

		SELECT 'COMPLETED';

	END IF;

ELSE	
	
	SELECT 'WINGING_IT';

END IF;

end$$

CREATE DEFINER=`intencit`@`localhost` PROCEDURE `getExercisePriority`(IN `email` VARCHAR(75))
begin

  declare EXCLUSION_LIST_PRIORITY int default -25;

  SELECT * 
  FROM(SELECT ExercisePriority.ExerciseName as ExerciseName, ExercisePriority.Priority as Priority
       FROM ExercisePriority
       WHERE ExercisePriority.Email = email
       UNION ALL
       SELECT Exclusion.ExclusionName, EXCLUSION_LIST_PRIORITY
       FROM Exclusion
       WHERE Exclusion.Email = email) as priority
  ORDER BY Priority DESC, ExerciseName ASC;

end$$

CREATE DEFINER=`intencit`@`localhost` PROCEDURE `getExercisesForToday`(IN `email` VARCHAR(75))
SELECT Exercise.ExerciseName, FLOOR(RAND() * IFNULL(exercisePriority.Priority, 10)) as Priority, completedExercise.ExerciseWeight, completedExercise.ExerciseReps, completedExercise.ExerciseDuration, completedExercise.ExerciseDifficulty, completedExercise.Notes
FROM Exercise
INNER JOIN MuscleGroup 
    ON Exercise.ExerciseName = MuscleGroup.ExerciseName
Inner JOIN Equipment
    ON Exercise.ExerciseName = Equipment.ExerciseName
LEFT JOIN (SELECT CompletedExercise.ExerciseName, CompletedExercise.ExerciseWeight, CompletedExercise.ExerciseReps, CompletedExercise.ExerciseDuration, CompletedExercise.ExerciseDifficulty, CompletedExercise.Notes
            FROM CompletedExercise
            WHERE CompletedExercise.Email = email
            ORDER BY CompletedExercise.ID DESC) as completedExercise
    ON completedExercise.ExerciseName = Exercise.ExerciseName 
LEFT JOIN (SELECT ExercisePriority.Priority, ExercisePriority.ExerciseName
            FROM ExercisePriority
            WHERE ExercisePriority.Email = email) as exercisePriority
    ON exercisePriority.ExerciseName = Exercise.ExerciseName
WHERE 
      Exercise.Type = 'E' && 
      Exercise.Recommended = 1 && 
      (MuscleGroup.MuscleGroupName IN (SELECT MuscleGroupRoutine.MuscleGroupName
                                       FROM MuscleGroupRoutine
                                       WHERE MuscleGroupRoutine.RoutineNumber = (SELECT MuscleGroupRoutine.RoutineNumber
                                                                                 FROM MuscleGroupRoutine
                                                                                 INNER JOIN CompletedMuscleGroup
                                                                                    ON CompletedMuscleGroup.MuscleGroupName = MuscleGroupRoutine.MuscleGroupName
                                                                                 WHERE CompletedMuscleGroup.Email = email
                                                                                 ORDER BY CompletedMuscleGroup.ID DESC
                                                                                 LIMIT 1) && 
                                            MuscleGroupRoutine.MuscleGroupName NOT IN (SELECT Exclusion.ExclusionName 
                                                                                       FROM Exclusion
                                                                                       WHERE Exclusion.Email = email && Exclusion.ExclusionType = 'M')) && 
      MuscleGroup.MuscleGroupExercisePercentage >= 50) && 
      (Equipment.EquipmentName IN (SELECT UserEquipment.EquipmentName 
                                    FROM UserEquipment 
                                    WHERE UserEquipment.Email = email) || Equipment.EquipmentName IS NULL) && 
      Exercise.ExerciseName NOT IN (SELECT Exclusion.ExclusionName
                                    FROM Exclusion 
                                    WHERE Exclusion.Email = email && Exclusion.ExclusionType = 'E')
GROUP BY Exercise.ExerciseName
ORDER BY Priority DESC$$

CREATE DEFINER=`intencit`@`localhost` PROCEDURE `getFollowing`(IN `email` VARCHAR(75))
SELECT User.ID, User.FirstName, User.LastName, User.EarnedPoints, 
		(SELECT COUNT(Badge.BadgeName)
         FROM Badge 
         WHERE Badge.Email = User.Email) AS TotalBadges, 
		(SELECT UserMedia.URL 
         FROM UserMedia 
         WHERE UserMedia.Email = User.Email 
         ORDER BY UserMedia.ID DESC LIMIT 1) as URL, 
		Following.ID AS FollowingId
FROM User 
LEFT JOIN Following
	ON Following.Following = User.Email AND Following.Email = email
WHERE Following.Email = email OR User.Email = email
ORDER BY User.EarnedPoints DESC$$

