CREATE DEFINER=`intencit`@`localhost` PROCEDURE `getIntencityRaffleWinner`()
begin

declare raffleWinner varchar(75);
declare raffleWinnerPoints int default 0;

declare lastWinner varchar(75);
declare secondToLastWinner varchar(75);
declare thirdTolastWinner varchar(75);

set lastWinner = (SELECT RaffleWinner.Email
                      FROM RaffleWinner
                      ORDER BY RaffleWinner.Date DESC
                      LIMIT 1) ;
    
set secondToLastWinner = (SELECT RaffleWinner.Email
                              FROM RaffleWinner
                              ORDER BY RaffleWinner.Date DESC
                              LIMIT 1, 1);

set thirdTolastWinner = (SELECT RaffleWinner.Email
                              FROM RaffleWinner
                              ORDER BY RaffleWinner.Date DESC
                              LIMIT 2, 1);

SET raffleWinner = (SELECT User.Email
                    FROM User 
                    WHERE User.EarnedPoints >= 1500 && 
                        User.CanRecievePrizes = 1 &&
                        User.Email != lastWinner &&
                        User.Email != secondToLastWinner &&
                        User.Email != thirdTolastWinner
                    ORDER BY RAND()
                    LIMIT 1);

SET raffleWinnerPoints = (SELECT User.EarnedPoints
                          FROM User
                          WHERE User.Email = raffleWinner);

SELECT User.FirstName, User.LastName, User.Email
FROM User 
WHERE User.Email = raffleWinner;

VALUES(raffleWinner, CURDATE(), raffleWinnerPoints);

/*UPDATE User 
SET User.EarnedPoints = 0;*/

end$$

CREATE DEFINER=`intencit`@`localhost` PROCEDURE `getMuscleGroups`(IN `email` VARCHAR(75))
begin

declare hasCompletedMuscleGroup int default 0;
declare totalRoutineNumber int default 0;
declare currentRoutineNumber int default 0;
declare lastCompletedMuscleGroupDate DATE;
declare lastCompletedExerciseDate DATE;

set lastCompletedMuscleGroupDate = (SELECT CompletedMuscleGroup.Date
                                    FROM CompletedMuscleGroup
                                    WHERE CompletedMuscleGroup.Email = email
                                    ORDER BY CompletedMuscleGroup.Date DESC 
                                    LIMIT 1);
                                    
set lastCompletedExerciseDate = (SELECT CompletedExercise.Date
                                 FROM CompletedExercise
                                 WHERE CompletedExercise.Email = email
                                 ORDER BY CompletedExercise.Date DESC 
                                 LIMIT 1);
                                 
IF (lastCompletedMuscleGroupDate > lastCompletedExerciseDate) THEN
	DELETE FROM CompletedMuscleGroup 
    WHERE CompletedMuscleGroup.Email = email && CompletedMuscleGroup.Date = lastCompletedMuscleGroupDate;
END IF;

set hasCompletedMuscleGroup = (SELECT CompletedMuscleGroup.ID
                               FROM CompletedMuscleGroup
                               WHERE CompletedMuscleGroup.Email = email && CompletedMuscleGroup.Date = DATE(NOW())
                               LIMIT 1);

IF (hasCompletedMuscleGroup IS NULL) THEN

    set totalRoutineNumber = (SELECT MuscleGroupRoutine.RoutineNumber
                              FROM MuscleGroupRoutine
                              ORDER BY MuscleGroupRoutine.RoutineNumber Desc
                              LIMIT 1);
    
    set currentRoutineNumber = ((SELECT MuscleGroupRoutine.RoutineNumber 
                                 FROM MuscleGroupRoutine
                                 WHERE MuscleGroupRoutine.MuscleGroupName = (SELECT CompletedMuscleGroup.MuscleGroupName 
                                                                             FROM CompletedMuscleGroup
                                                                             WHERE CompletedMuscleGroup.Email = email
                                                                             ORDER BY CompletedMuscleGroup.Date DESC
                                                                             LIMIT 1)) + 1);
                                                           
    IF (currentRoutineNumber > totalRoutineNumber) OR (currentRoutineNumber IS NULL) THEN
        SET currentRoutineNumber = 1;
    END IF;
    
    SELECT email, Now(), MuscleGroupRoutine.MuscleGroupName
    FROM MuscleGroupRoutine
    WHERE MuscleGroupRoutine.RoutineNumber = currentRoutineNumber;

END IF;

end$$

CREATE DEFINER=`intencit`@`localhost` PROCEDURE `getPosts`(IN `userID` INT)
begin

SELECT User.ID AS userId,
		User.FirstName,
		User.LastName,
		Post.Date,
		Post.Time,
		Post.Post,
		Post.Email,
		Post.ID,
		(SELECT UserMedia.URL 
         FROM UserMedia 
         WHERE UserMedia.Email = Post.Email
         ORDER BY UserMedia.ID DESC 
         LIMIT 1) as URL
FROM Post 
INNER JOIN User 
	ON User.Email=Post.Email 
WHERE User.ID = userID OR 
		User.ID IN (SELECT User.ID 
                    FROM User 
                    INNER JOIN Following 
                    	ON Following.Following = User.Email 
                    WHERE Following.Email= (SELECT User.Email 
                                            FROM User 
                                            WHERE ID = userID))
ORDER BY Post.Date DESC, Post.Time DESC;

end$$

